import "./Test.css";
import Button from "../components/Button";
import { useNavigate } from "react-router-dom";

const Test = ({}) => {
    const navigate = useNavigate();
    const goNext = () => {
        navigate(`/`);
    }
    const goBack = () => {
        navigate(-1);
    }
    return (
        <div>
            <div className="selection">
                <Button text="1"/>
                <Button text="2"/>
                <Button text="3"/>
                <Button text="4"/>
                <Button text="5"/>
            </div>
            <Button text="< 이전" onClick={goBack}/>
            <Button text="다음 >" onClick={goNext}/>
        </div>
    )
}

export default Test;
